import React from 'react';

function QuizPage() {
  // This will be expanded to fetch and display quiz questions
  return (
    <div className="container">
      <h1>Quiz Page</h1>
      <p>The quiz will be displayed here.</p>
    </div>
  );
}

export default QuizPage;
